class Solution:
    def solve(self, board):
        """
        :type board: List[List[str]]
        :rtype: void Do not return anything, modify board in-place instead.
        """

        def check(data, x,y,u, output):
            t=str(x)+"_"+str(y)
            if t in u:
                return True
            u.add(t)
            if data[x][y]=='O' and(x-1<0 or x>=len(data) or y<0 or y>=len(data[x])):
                output=[]
                return False
            
            if data[x][y]=='X':
                return True
            else:
                output.append((x,y))
            a=False
            if x-1>=0:
                a=check(data,x-1,y,u, output)
            b=False
            if x+1<len(data):
                b=check(data,x+1,y,u,output)
            c=False
            if y-1>=0:
                c=check(data,x,y-1,u, output)

            d=False
            if y+1<len(data[x]):
                d=check(data,x,y+1,u, output)

            if a and b and c and d:
                return True
            
            output=[]
            return False
        


        def check2(data, x,y,u, output):
            t=str(x)+"_"+str(y)
            if t in u:
                return True
            u.add(t)
            if data[x][y]=='O' and(x-1<0 or x>=len(data) or y<0 or y>=len(data[x])):
                output=[]
                return False
            
            if data[x][y]=='X':
                return True
            else:
                output.append((x,y))
            a=False
            if x-1>=0:
                a=check(data,x-1,y,u, output)
            b=False
            if x+1<len(data):
                b=check(data,x+1,y,u,output)
            c=False
            if y-1>=0:
                c=check(data,x,y-1,u, output)

            d=False
            if y+1<len(data[x]):
                d=check(data,x,y+1,u, output)

            if a and b and c and d:
                return True
            
            output=[]
            return False

            
        u=set()
        for i in range(len(board)):
            for j in range(0, len(board[i])):
                if str(i)+"_"+str(j) in u:
                    continue
                if board[i][j]=='O':
                    output=[]
                    if  check2(board,i,j,u,output):
                        for k in range(len(output)):
                            board[output[k][0]][output[k][1]]='X'
                        board[i][j]='X'
